import React, { useState } from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faBars } from '@fortawesome/free-solid-svg-icons';
import './navbar.css';

function Navbar() {
  const [navState, setNavState] = useState(0); // 0: hidden, 1: navbar1, 2: navbar2

  const handleNavbarToggle = () => {
    setNavState((prevState) => (prevState + 1) % 3); // Cycles through 0 -> 1 -> 2 -> 0
  };

  return (
    <nav className="navbar">
      {/* Header Section (Logo and Navbar1) */}
      <div className="navbar-header">
        {window.innerWidth > 500 && (
          <div className="navbar-hamburger" onClick={handleNavbarToggle}>
            <FontAwesomeIcon icon={faBars} />
          </div>
        )}
        <div className="navbar-logo">
          <h1>Business Solution</h1>
        </div>
        {/* Navbar1 (right aligned) */}
        <div className="navbar1">
          <ul className="navbar-menu">
            <li>Driver</li>
            <li>Rider</li>
            <li>Business</li>
            <li>Log in</li>
            <li>Sign up</li>
          </ul>
        </div>
      </div>

      {/* Mobile Menu for Navbar1 */}
      {navState === 1 && (
        <div className="mobile-menu">
          <ul className="navbar-menu">
            <li>Driver</li>
            <li>Rider</li>
            <li>Business</li>
            <li>Log in</li>
            <li>Sign up</li>
          </ul>
        </div>
      )}

      {/* Conditional rendering for Navbar2 */}
      {navState === 2 && (
        <div className="navbar2">
          <ul className="navbar-menu2">
            <li>Products</li>
            <li>Solutions</li>
            <li>Customers</li>
            <li>Resources</li>
            <li>Contact us</li>
            <li>Get started</li>
          </ul>
        </div>
      )}
    </nav>
  );
}

export default Navbar;
